"""
LeetCode
2147. Number of Ways to Divide a Long Corridor
November 2023 Challenge
jramaswami
"""


import functools


class Solution:
    def numberOfWays(self, corridor: str) -> int:
        MOD = pow(10, 9) + 7

        @functools.cache
        def rec(i, seats):
            seats0 = seats + 1 if corridor[i] == 'S' else seats

            # Base case.
            if i == len(corridor) - 1:
                if seats0 == 2:
                    return 1
                return 0

            # Base case adding disallowed seat.
            if seats0 > 2:
                return 0

            # No partition after this.
            result = rec(i+1, seats0)
            if seats0 == 2:
                # Partition after this
                result += rec(i+1, 0)
                result %= MOD
            return result % MOD

        return rec(0, 0) % MOD


def test_1():
    corridor = "SSPPSPS"
    expected = 3
    assert Solution().numberOfWays(corridor) == expected


def test_2():
    corridor = "PPSPSP"
    expected = 1
    assert Solution().numberOfWays(corridor) == expected


def test_3():
    corridor = "S"
    expected = 0
    assert Solution().numberOfWays(corridor) == expected


def test_4():
    "MLE"
    corridor = ""
    expected = 0
    assert Solution().numberOfWays(corridor) == expected